import { useState, useEffect } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

// Import all components with error handling
let LandingPage, CartPage, ProductPage, ProductsPage, ContactPage, CheckoutPage;

try {
  LandingPage = require("./landing_page").default;
  CartPage = require("./CartPage").default;
  ProductPage = require("./ProductPage").default;
  ProductsPage = require("./products_page").default;
  ContactPage = require("./ContactPage").default;
  CheckoutPage = require("./CheckoutPage").default;
  // CheckoutSuccess = require("./CheckoutSuccess").default;
} catch (error) {
  console.error("Component import error:", error);
}

// Import cart utilities with error handling
let loadCartFromLocalStorage, saveCartToLocalStorage;
try {
  const cartUtils = require("./cartUtils");
  loadCartFromLocalStorage = cartUtils.loadCartFromLocalStorage;
  saveCartToLocalStorage = cartUtils.saveCartToLocalStorage;
} catch (error) {
  console.error("cartUtils import error:", error);
  // Fallback implementations
  loadCartFromLocalStorage = () => [];
  saveCartToLocalStorage = () => {};
}

function App() {
  const [cart, setCart] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const SHIPPING_COST = 0;

  useEffect(() => {
    try {
      const loadedCart = loadCartFromLocalStorage();
      if (loadedCart && loadedCart.length > 0) {
        setCart(loadedCart);
      }
      setLoading(false);
    } catch (err) {
      console.error("Failed to load cart:", err);
      setError("Failed to load shopping cart");
      setLoading(false);
    }
  }, []);

  useEffect(() => {
    try {
      saveCartToLocalStorage(cart);
    } catch (err) {
      console.error("Failed to save cart:", err);
    }
  }, [cart]);

  const addToCart = (product, selectedSize = null, selectedColor = null) => {
    try {
      setCart((prevCart) => {
        const requiresOptions =
          product.product_type === "TSHIRT" ||
          (product.images && product.images.some((img) => img.color));

        const existingItem = prevCart.find(
          (item) =>
            item.id === product.id &&
            (!requiresOptions ||
              (item.selectedSize === selectedSize &&
                item.selectedColor === selectedColor))
        );

        return existingItem
          ? prevCart.map((item) =>
              item.id === existingItem.id
                ? {
                    ...item,
                    quantity: item.quantity + 1,
                    selectedSize: selectedSize || item.selectedSize,
                    selectedColor: selectedColor || item.selectedColor,
                  }
                : item
            )
          : [
              ...prevCart,
              {
                ...product,
                quantity: 1,
                selectedSize,
                selectedColor,
              },
            ];
      });
    } catch (err) {
      console.error("Failed to add to cart:", err);
      setError("Failed to add item to cart");
    }
  };

  // Other cart operations (updateQuantity, removeFromCart, etc.) with similar try-catch blocks

  const subtotal = cart.reduce((total, item) => {
    try {
      const price = typeof item.price === "string" ? parseFloat(item.price) : item.price;
      return total + price * item.quantity;
    } catch {
      return total;
    }
  }, 0);

  const total = subtotal + SHIPPING_COST;

  if (loading) return <div className="loading">Loading...</div>;
  if (error) return <div className="error">Error: {error}</div>;

  return (
    <Router>
      <div className="app-container">
        <main className="app-main">
          <Routes>
            <Route
              path="/"
              element={<LandingPage cart={cart} addToCart={addToCart} />}
            />
            <Route
              path="/products"
              element={<ProductsPage cart={cart} addToCart={addToCart} />}
            />
            <Route
              path="/cart"
              element={
                <CartPage
                  cart={cart}
                  subtotal={subtotal}
                  shippingCost={SHIPPING_COST}
                  updateQuantity={updateQuantity}
                  removeFromCart={removeFromCart}
                  updateCartItemOptions={updateCartItemOptions}
                />
              }
            />
            <Route
              path="/products/:id"
              element={<ProductPage addToCart={addToCart} cart={cart} />}
            />
            <Route path="/contact" element={<ContactPage />} />
            <Route
              path="/checkout"
              element={
                <CheckoutPage
                  cart={cart}
                  subtotal={subtotal}
                  shippingCost={SHIPPING_COST}
                  total={total}
                  setCart={setCart}
                />
              }
            />
          </Routes>
        </main>
        <footer className="footer">
          <p>&copy; {new Date().getFullYear()} MoroTote. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
